description:
Another collection of 5 chess books, 4 PDFs &amp; 1 MOBI. I could not convert the mobi to epub &amp; it opens well only with my Sumatra PDF!

1. Mating the Castled King by Danny Gormally
2. Tactics Time! - 1001 Chess Tactics from the Games of Everyday Chess Players
3. The Chigorin Defence According to Morozevich - A World Class Player on the Opening He Made Popular (MOBI)
4. The Minor Tactics of Chess by Franklin K. Young
5. The Petroff Defence by Artur Yusupov
